import React from 'react';
import styles from './SearchBar.modules.css';

const SearchBar = () => {
    return (
      <input
        value={text}
        //onChange={this.onTextChanged}
        type="text"
        placeholder="Search by App"
      />
    );
}
 
export default SearchBar;
